Objective-C/Runtime/浅谈Associated Objects.body:
作者：冬瓜
原文链接：Guardia · 瓜地

浅谈Associated Objects
俗话说：“金无足赤，人无完人。”对于每一个Class也是这样，尽管我们说这个Class的代码规范、逻辑清晰合理等等，但是总会有它的短板，或者随着需求演进而无法订制实现功能。于是在Objective-C 2.0中引入了category这个特性，用以动态地为已有类添加新行为。面向对象的设计用来描述事物的组成往往是使用Class中的属性成员，这也就局限了方法的广度（在官方文档称之为An otherwise notable shortcoming for Objective-C，译为：Objc的一个显著缺陷）。所以在Runtime中引入了Associated Objects来弥补这一缺陷。
另外，请带着以下疑问来阅读此文：

Associated Objects 使用场景。
Associated Objects 五种objc_AssociationPolicy有什么区别。
Associated Objects 的存储结构。

Associated Objects Introduction
Associated Objects是Objective-C 2.0中Runtime的特性之一。最早开始使用是在OS X Snow Leopard和iOS 4中。在中定义的三个方法，也是我们深入探究Associated Objects的突破口：

objc_setAssociatedObject
objc_getAssociatedObject
objc_removeAssociatedObjects


void objc_setAssociatedObject(id object, const void *key, id value, objc_AssociationPolicy policy)


object：传入关联对象的所属对象，也就是增加成员的实例对象，一般来说传入self。
key：一个唯一标记。在官方文档中推荐使用static char，当然更推荐是指针。为了便捷，一般使用selector，这样在后面getter中，我们就可以利用_cmd来方便的取出selector。
value：传入关联对象。
policy：objc_AssociationPolicy是一个ObjC枚举类型，也代表关联策略。


void objc_setAssociatedObject(id object, const void *key, id value, objc_AssociationPolicy policy)
void objc_removeAssociatedObjects(id object)

从参数类型参数类型上，我们可以轻易的得出getter和remove方法传入参数的含义。要注意的是，objc_removeAssociatedObjects这个方法会移除一个对象的所有关联对象。其实，该方法我们一般是用不到的，移除所有关联意味着将类恢复成无任何关联的原始状态，这不是我们希望的。所以一般的做法是通过objc_setAssociatedObject来传入nil，从而移除某个已有的关联对象。
我们用Associated Objects这篇文中的例子来举例：
// NSObject+AssociatedObject.h

@interface NSObject (AssociatedObject)
@property (nonatomic, strong) id associatedObject;
@end

// NSObject+AssociatedObject.m

@implementation NSObject (AssociatedObject)
@dynamic associatedObject;

- (void)setAssociatedObject:(id)object {
     objc_setAssociatedObject(self, @selector(associatedObject), object, OBJC_ASSOCIATION_RETAIN_NONATOMIC);
}

- (id)associatedObject {
    return objc_getAssociatedObject(self, @selector(associatedObject));
}

这时我们已经发现associatedObject这个属性已经添加至NSObject的实例中了。并且我们可以通过category指定的getter和setter方法对这个属性进行存取操作。（注：这里使用@dynamic关键字是为了告知编译器：在编译期不要自动创建实现属性所用的存取方法。因为对于Associated Objects我们必须手动添加。当然，不写这个关键字，使用同名方法进行override也是可以达到相同效果的。但从编码规范和优化效率来讲，显式声明是最好的。）

AssociationPolicy
通过上面的例子，我们注意到了OBJC_ASSOCIATION_RETAIN_NONATOMIC这个参数，它的枚举类型各个元素的含义如下：



Behavior
@property Equivalent
Description




OBJC_ASSOCIATION_ASSIGN
@property (assign) 或 @property (unsafe_unretained)
指定一个关联对象的弱引用。


OBJC_ASSOCIATION_RETAIN_NONATOMIC
@property (nonatomic, strong)
指定一个关联对象的强引用，不能被原子化使用。


OBJC_ASSOCIATION_COPY_NONATOMIC
@property (nonatomic, copy)
指定一个关联对象的copy引用，不能被原子化使用。


OBJC_ASSOCIATION_RETAIN
@property (atomic, strong)
指定一个关联对象的强引用，能被原子化使用。


OBJC_ASSOCIATION_COPY
@property (atomic, copy)
指定一个关联对象的copy引用，能被原子化使用。


OBJC_ASSOCIATION_GETTER_AUTORELEASE

自动释放类型 



OBJC_ASSOCIATION_ASSIGN类型的关联对象和weak有一定差别，而更加接近于unsafe_unretained，即当目标对象遭到摧毁时，属性值不会自动清空。（翻译自Associated Objects）
Usage Sample
同样是Associated Objects文中，总结了三个关于Associated Objects用法：

为Class添加私有成员：例如在AFNetworking中，在UIImageView里添加了imageRequestOperation对象，从而保证了异步加载图片。
为Class添加共有成员：例如在FDTemplateLayoutCell中，使用Associated Objects来缓存每个cell的高度（代码片段1、代码片段2）。通过分配不同的key，在复用cell的时候即时取出，增加效率。
创建KVO对象：建议使用category来创建关联对象作为观察者。可以参考Objective-C Associated Objects这篇文的例子。

Analysis Source Code
在Objective-C Associated Objects 的实现原理这篇文中，作者有一个例子，作者分析了在Associated Objects中弱引用的区别。其代码片段如下：
#import "ViewController.h"
#import "ViewController+AssociatedObjects.h"

__weak NSString *string_weak_assign = nil;
__weak NSString *string_weak_retain = nil;
__weak NSString *string_weak_copy   = nil;

@implementation ViewController

- (void)viewDidLoad {
    [super viewDidLoad];
    // 通过[NSString stringWithFormat:]来持有一个字符串对象
    self.associatedObject_assign = [NSString stringWithFormat:@"associatedObject_assign"];
    self.associatedObject_retain = [NSString stringWithFormat:@"associatedObject_retain"];
    self.associatedObject_copy   = [NSString stringWithFormat:@"associatedObject_copy"];

    // 强调指向各个属性的指针均为弱类型指针
    // 以保证weak、assign类型属性会被释放
    string_weak_assign = self.associatedObject_assign;
    string_weak_retain = self.associatedObject_retain;
    string_weak_copy   = self.associatedObject_copy;
}

- (void)touchesBegan:(NSSet *)touches withEvent:(UIEvent *)event {
    NSLog(@"self.associatedObject_assign: %@", self.associatedObject_assign); // Will Crash
    NSLog(@"self.associatedObject_retain: %@", self.associatedObject_retain);
    NSLog(@"self.associatedObject_copy:   %@", self.associatedObject_copy);
}

@end

在测试时候，我们发现有些情况下不至于导致crash。我猜想可能是因为[NSString stringWithFormat:]方法的持有字符串可能会被编译器优化成compile-time constant。你可以尝试着做如下修改：
self.associatedObject_assign = @"associatedObject_assign";
self.associatedObject_retain = @"associatedObject_retain";
self.associatedObject_copy   = @"associatedObject_copy";

你会发现全部正常输出。因为所有字符串都变成了编译期常量而存储起来。所以探究方法，应该是讲类型更改成NSObject进行试验。
Setter Source Code
我们一直有个疑问，就是关联对象是如何存储的。下面我们看下Runtime的源码。
以下源码来自于opensource.apple.com的objc4-680.tar.gz。
class ObjcAssociation {
   uintptr_t _policy;
   id _value;
public:
   ObjcAssociation(uintptr_t policy, id value) : _policy(policy), _value(value) {}
   ObjcAssociation() : _policy(0), _value(nil) {}

   uintptr_t policy() const { return _policy; }
   id value() const { return _value; }

   bool hasValue() { return _value != nil; }
};

class AssociationsHashMap : public unordered_map {
public:
   void *operator new(size_t n) { return ::malloc(n); }
   void operator delete(void *ptr) { ::free(ptr); }
};

class AssociationsManager {
    static spinlock_t _lock;
    static AssociationsHashMap *_map;               // associative references:  object pointer -> PtrPtrHashMap.
public:
    AssociationsManager()   { _lock.lock(); }
    ~AssociationsManager()  { _lock.unlock(); }

    AssociationsHashMap &associations() {
        if (_map == NULL)
            _map = new AssociationsHashMap();
        return *_map;
    }
};

static id acquireValue(id value, uintptr_t policy) {
    // 遇见不合法policy或者assign直接返回，也就是说将其他无效policy当做assign处理
    switch (policy & 0xFF) {
    case OBJC_ASSOCIATION_SETTER_RETAIN:
        return ((id(*)(id, SEL))objc_msgSend)(value, SEL_retain);
    case OBJC_ASSOCIATION_SETTER_COPY:
        return ((id(*)(id, SEL))objc_msgSend)(value, SEL_copy);
    }
    return value;
}

inline disguised_ptr_t DISGUISE(id value) { return ~uintptr_t(value); }

void _object_set_associative_reference(id object, void *key, id value, uintptr_t policy) {
    // retain the new value (if any) outside the lock.
    // 创建一个ObjcAssociation对象
    ObjcAssociation old_association(0, nil);

    // 通过policy为value创建对应属性，如果policy不存在，则默认为assign
    id new_value = value ? acquireValue(value, policy) : nil;
    {
        // 创建AssociationsManager对象
        AssociationsManager manager;

        // 在manager取_map成员，其实是一个map类型的映射
        AssociationsHashMap &associations(manager.associations());

        // 创建指针指向即将拥有成员的Class
        // 至此该类已经包含这个关联对象
        disguised_ptr_t disguised_object = DISGUISE(object);

         // 以下是记录强引用类型成员的过程
        if (new_value) {
            // break any existing association.
            // 在即将拥有成员的Class中查找是否已经存在改关联属性
            AssociationsHashMap::iterator i = associations.find(disguised_object);
            if (i != associations.end()) {
                // secondary table exists
                // 当存在时候，访问这个空间的map
                ObjectAssociationMap *refs = i->second;
                // 遍历其成员对应的key
                ObjectAssociationMap::iterator j = refs->find(key);
                if (j != refs->end()) {
                    // 如果存在key，重新更改Key的指向到新关联属性
                    old_association = j->second;
                    j->second = ObjcAssociation(policy, new_value);
                } else {
                    // 否则以新的key创建一个关联
                    (*refs)[key] = ObjcAssociation(policy, new_value);
                }
            } else {
                // create the new association (first time).
                // key不存在的时候，直接创建关联
                ObjectAssociationMap *refs = new ObjectAssociationMap;
                associations[disguised_object] = refs;
                (*refs)[key] = ObjcAssociation(policy, new_value);
                object->setHasAssociatedObjects();
            }
        } else {
            // setting the association to nil breaks the association.
            // 这种情况是policy不存在或者为assign的时候
            // 在即将拥有的Class中查找是否已经存在Class
            // 其实这里的意思就是如果之前有这个关联对象，并且是非assign形的，直接erase
            AssociationsHashMap::iterator i = associations.find(disguised_object);
            if (i != associations.end()) {
                // 如果有该类型成员检查是否有key
                ObjectAssociationMap *refs = i->second;
                ObjectAssociationMap::iterator j = refs->find(key);
                if (j != refs->end()) {
                    // 如果有key，记录旧对象，释放
                    old_association = j->second;
                    refs->erase(j);
                }
            }
        }
    }
    // release the old value (outside of the lock).
    // 如果存在旧对象，则将其释放
    if (old_association.hasValue()) ReleaseValue()(old_association);
}

我们读过代码后发现是其储存结构是这样的一个逻辑：


橙色的是AssociationsManager是顶级结构体，维护了一个spinlock_t锁和一个_map的哈希表。这个哈希表中的键为disguised_ptr_t，在得到这个指针的时候，源码中执行了DISGUISE方法，这个方法的功能是获得指向self地址的指针，即为指向对象地址的指针。通过地址这个唯一标识，可以找到对应的value，即一个子哈希表。（@饶志臻 勘误）
子哈希表是ObjectAssociationMap，键就是我们传入的Key，而值是ObjcAssociation，即这个成员对象。从而维护一个成员的所有属性。

在每次执行setter方法的时候，我们会逐层遍历Key，逐层判断。并且当持有Class有了关联属性的时候，在执行成员的Getter方法时，会优先查找Category中的关联成员。
这样会带来一个问题：如果category中的一个关联对象与Class中的某个成员同名，虽然key值不一定相同，自身的Class不一定相同，policy也不一定相同，但是我这样做会直接覆盖之前的成员，造成无法访问，但是其内部所有信息及数据全部存在。例如我们对ViewController做一个Category，来创建一个叫做view的成员，我们会发现在运行工程的时候，模拟器直接黑屏。

我们在viewDidLoad中下断点，甚至无法进入debug模式。因为view属性已经被覆盖，所以不会继续进行viewController的生命周期。

这一点很危险，所以我们要杜绝覆盖Class原来的属性，这会破坏Class原有的功能。（当然，我是十分不推荐在业务项目中使用Runtime的，因为这样的代码可读性和维护性太低。）
Getter Source Code & Remove
这两种方法我们直接看源码，在看过Setter中的遍历嵌套map结构的代码片段后，你会很容易理解这两个方法。
id _object_get_associative_reference(id object, void *key) {
    id value = nil;
    uintptr_t policy = OBJC_ASSOCIATION_ASSIGN;
    {
        AssociationsManager manager;
        AssociationsHashMap &associations(manager.associations());
        disguised_ptr_t disguised_object = DISGUISE(object);
        AssociationsHashMap::iterator i = associations.find(disguised_object);
        if (i != associations.end()) {
            ObjectAssociationMap *refs = i->second;
            ObjectAssociationMap::iterator j = refs->find(key);
            if (j != refs->end()) {
                ObjcAssociation &entry = j->second;
                value = entry.value();
                policy = entry.policy();
                if (policy & OBJC_ASSOCIATION_GETTER_RETAIN) ((id(*)(id, SEL))objc_msgSend)(value, SEL_retain);
            }
        }
    }
    if (value && (policy & OBJC_ASSOCIATION_GETTER_AUTORELEASE)) {
        ((id(*)(id, SEL))objc_msgSend)(value, SEL_autorelease);
    }
    return value;
}

void _object_remove_assocations(id object) {
    vector > elements;
    {
        AssociationsManager manager;
        AssociationsHashMap &associations(manager.associations());
        if (associations.size() == 0) return;
        disguised_ptr_t disguised_object = DISGUISE(object);
        AssociationsHashMap::iterator i = associations.find(disguised_object);
        if (i != associations.end()) {
            // copy all of the associations that need to be removed.
            ObjectAssociationMap *refs = i->second;

            // 将所有的关联成员放到一个vector，然后统一清理
            for (ObjectAssociationMap::iterator j = refs->begin(), end = refs->end(); j != end; ++j) {
                elements.push_back(j->second);
            }
            // remove the secondary table.
            delete refs;
            associations.erase(i);
        }
    }
    // the calls to releaseValue() happen outside of the lock.
    for_each(elements.begin(), elements.end(), ReleaseValue());
}

另外，对于remove有一点补充。在Runtime的销毁对象函数objc_destructInstance里面会判断这个对象有没有关联对象，如果有，会调用_object_remove_assocations做关联对象的清理工作。
Thinking About Hash Table
不光是本文讲述的关于Class关联对象的存储方式，还是Apple中其他的Souce Code（例如引用计数管理），我们能感受到Apple对Hash Table（本文中的map数据结构）这种数据结构情有独钟。在大量的实践中可以说明，Hash Table对于优化效率的提升，这是毋庸置疑的。
细究使用这种数据结构的原因，唯一的Key可对应指定的Value。我们从计算机存储的角度考虑，因为每个内存地址是唯一的，也就可以假象成Key，通过唯一的Key来读写数据，这是效率最高的方式。
The End
通过阅读此文，想必你已经知道那三个问题的答案。笔者原本想对UITableView-FDTemplateLayoutCell进行源码分析来撰写一篇文，但是发现里面存储cell的Key值使用到了Associated Objects该技术，所以对此进行了学习探究。后面，我会分析一下UITableView-FDTemplateLayoutCell的源码，这些将收录在我的这个Github仓库中。

Objective-C/Runtime/objc_msgSend消息传递学习笔记.body:
作者：冬瓜
原文链接：Guardia · 瓜地

对象方法消息传递流程
在Effective Objective-C 2.0 - 52 Specific Ways to Improve Your iOS and OS X Programs一书中，tip 11主要讲述了Objective-C中的消息传递机制。这也是Objective-C在C的基础上，做的最基础也是最重要的封装。
Static Binding And Dynamic Binding
C中的函数调用方式，是使用的静态绑定(static binding)，即在编译期就能决定运行时所应调用的函数。而在Objective-C中，如果向某对象传递消息，就会使用动态绑定机制来决定需要调用的方法。而对于Objective-C的底层实现，都是C的函数。对象在收到消息之后，调用了哪些方法，完全取决于Runtime来决定，甚至可以在Runtime期间改变。
一般地，对对象发送消息，我们使用这种写法：
id returnValue = [DGObject test];

其中someObject为接收者(receiver)，messageName为选择子(selector)。当Compiler看的这条语句时，会将其转换成为一条标准的消息传递的C函数，objc_msgSend，形如：
void objc_msgSend(id self, SEL cmd, ...)

其中，SEL也就是之前对应的选择子，即为此文讨论的重点。我们对应的写出之前代码在Compiler处理后的C语句：
id returnValue = objc_msgSend(DGObject, @selector(test));

@selector()
对于SEL类型，也就是我们经常使用的@selector()，在很多的书籍资料中的定义是这样：
typedef struct objc_selector *SEL;

而至于这个objc_selector的结构体是如何定义的，这就要取决于我们Runtime框架的类型，在iOS开发中，我们使用的是Apple的(GNU也有Runtime的framework)。在OS X中SEL被映射成为一个C字符串(char[])，这个字符串也就是方法名。
我们在lldb中，进行测试：

(图释：test是在DGObjectClass中已经定义的方法名，而not_define_test和not_define_test_2没有定义)
第一行我们验证了@selector是一个char[]类型。其他的结果我们可以总结出：@selector()选择子只与函数名有关。而且还有一个规律，那就是倘若选择子方法已经在编译期由Compiler进行静态绑定，则其存储的地址就会更加的具体。
发送消息所依托的选择子只与函数名有关，我们便可以猜想到为什么Objective-C中没有像C++、C#那样的函数重载特性，因为选择子并不由参数和函数名共同决定。
那么为什么要有这个选择子呢？在从源代码看 ObjC 中消息的发送一文中，作者Draveness对其原因进行了推断：


Objective-C 为我们维护了一个巨大的选择子表
在使用 @selector() 时会从这个选择子表中根据选择子的名字查找对应的 SEL。如果没有找到，则会生成一个 SEL 并添加到表中
在编译期间会扫描全部的头文件和实现文件将其中的方法以及使用 @selector() 生成的选择子加入到选择子表中


objc_msgSend
在选择子拿到对应的地址后，objc_msgSend会依据接收者与选择子的类型来调用适当方法。为了学习此过程，我从opensource.apple.com的git仓库中clone了Runtime源码，并在x86_64架构下macOS环境进行运行。
另外，我在整个工程中增加了一个Class: 
// DGObject.h
@interface DGObject : NSObject
- (void)test;
@end

// DGObject.m
#import "DGObject.h"
@implementation DGObject

- (void)test {
    printf("Hello World. ");
}
@end

并在main入口函数中进行改动：
int main(int argc, const char * argv[]) {
    @autoreleasepool {
        DGObject *obj = [[DGObject alloc]init];
        NSLog(@"%p", @selector(test));
        [obj test];
    }
    return 0;
}

然后我们在objc-runtime-new.mm中，进行debug。为了研究清楚Runtime是如何查询到调用函数，我们在lookUpImpOrForward下断点。当程序执行[obj test]后，我们发现到达断点位置，并且观察此时的调用栈情况：

objc_msgSend并不是直接调用查询方法，而是先调用了_class_lookupMethodAndLoadCache3这个函数。看下它的源码：
IMP _class_lookupMethodAndLoadCache3(id obj, SEL sel, Class cls){
    return lookUpImpOrForward(cls, sel, obj, 
                              YES/*initialize*/, NO/*cache*/, YES/*resolver*/);
}

_class_lookupMethodAndLoadCache3就好像一个中转函数，并给出了在查询IMP指针前默认参量的几个布尔值。而由于我们的方法没有进行方法转发，则直接调用了_class_lookupMethodAndLoadCache3这个函数。而当对象在收到无法解读的消息之后，即启动消息转发机制，这时候应该会进入lookUpImpOrNil这个方法。这也是objc_msgSend的一种优化方式。
这里还要注意一点，就是关于Cache的默认参数是NO，因为在objc_msgSend中已经进行过缓存查询。以下是objc_msgSend的汇编实现：
ENTRY    _objc_msgSend
    MESSENGER_START
    // NilTest:宏，判断被发送消息的对象是否为nil。
    // 如果为nil直接返回。
    NilTest    NORMAL

    // GetIsaFast快速获取isa指针地址，并放入r11寄存器
    GetIsaFast NORMAL        // r11 = self->isa

    // 查找类缓存中selector的IMP指针，并放到r10寄存器
    // 如果不存在，则在class的方法list中查询
    CacheLookup NORMAL        // calls IMP on success
    // NilTest的许可量以及GetIsaFast的许可量
    NilTestSupport    NORMAL
    GetIsaSupport    NORMAL

// cache miss: go search the method lists
LCacheMiss:
    // isa still in r11
    // MethodTableLoopup这个宏是__class_lookupMethodAndLoadCache3函数的入口
    // 调用条件是在缓存中没有查询到方法对应IMP
    MethodTableLookup %a1, %a2    // r11 = IMP
    cmp    %r11, %r11        // set eq (nonstret) for forwarding
    jmp    *%r11            // goto *imp

    END_ENTRY    _objc_msgSend

趁热打铁，再来看一下MethodTableLoopup这个宏的实现：
.macro MethodTableLookup

    MESSENGER_END_SLOW

    SaveRegisters

    // _class_lookupMethodAndLoadCache3(receiver, selector, class)
    // 从a1, a2, a3中分别拿到对应参数
    movq    $0, %a1
    movq    $1, %a2
    movq    %r11, %a3
    // 调用__class_lookupMethodAndLoadCache3
    call    __class_lookupMethodAndLoadCache3

    // IMP is now in %rax
    // 将IMP从r11挪至rax
    movq    %rax, %r11

    RestoreRegisters

.endmacro

而在objc-msg-x86_64.s中有多个以objc_msgSend为前缀的方法，这个是根据返回值类型和调用者类型分别处理的，我列举三个常用的



objc_msgSend_stret
待发送的消息要返回结构体前提是只有当CPU的寄存器能够容纳的下消息返回类型。




objc_msgSend_fpret
消息返回的是浮点数。因为某些架构的CPU调用函数，需要对浮点数寄存器做特殊处理。


objc_msgSendSuper
需要向superClass发送消息时调用。



lookUpImpOrForward
之后我们随着调用栈往上看，在接受到消息入口的命令后，Runtime要开始进行查找方法的操作，源码如下：
IMP lookUpImpOrForward(Class cls, SEL sel, id inst, 
                       bool initialize, bool cache, bool resolver) {
    Class curClass;
    IMP imp = nil;
    Method meth;
    bool triedResolver = NO;

    runtimeLock.assertUnlocked();

    // 检查是否添加缓存锁，如果没有进行缓存查询。
    // 查到便返回IMP指针
    if (cache) {
        imp = cache_getImp(cls, sel);
        if (imp) return imp;
    }
    // 通过调用realizeClass方法，分配可读写`class_rw_t`的空间
    if (!cls->isRealized()) {
        rwlock_writer_t lock(runtimeLock);
        realizeClass(cls);
    }

    // 倘若未进行初始化，则初始化
    if (initialize  &&  !cls->isInitialized()) {
        _class_initialize (_class_getNonMetaClass(cls, inst));
    }
    // 保证方法查询，并进行缓存填充(cache-fill)
      retry:
    runtimeLock.read();

    // 是否忽略GC垃圾回收机制（仅用在macOS中）
    if (ignoreSelector(sel)) {
        imp = _objc_ignored_method;
        cache_fill(cls, sel, imp, inst);
        goto done;
    }

    // 当前类的缓存列表中进行查找
    imp = cache_getImp(cls, sel);
    if (imp) goto done;

    // 从类的方法列表中进行查询
    meth = getMethodNoSuper_nolock(cls, sel);
    if (meth) {
        log_and_fill_cache(cls, meth->imp, sel, inst, cls);
        imp = meth->imp;
        goto done;
    }

    // 从父类中循环遍历
    curClass = cls;
    while ((curClass = curClass->superclass)) {
        // 父类的缓存列表中查询
        imp = cache_getImp(curClass, sel);
        if (imp) {
            if (imp != (IMP)_objc_msgForward_impcache) {
                // 如果在父类中发现方法，则填充到该类缓存列表
                log_and_fill_cache(cls, imp, sel, inst, curClass);
                goto done;
            }
            else {
                break;
            }
        }

        // 从父类的方法列表中查询
        meth = getMethodNoSuper_nolock(curClass, sel);
        if (meth) {
            log_and_fill_cache(cls, meth->imp, sel, inst, curClass);
            imp = meth->imp;
            goto done;
        }
    }

    // 进入method resolve过程
    if (resolver  &&  !triedResolver) {
        runtimeLock.unlockRead();
        // 调用_class_resolveMethod，解析没有实现的方法
        _class_resolveMethod(cls, sel, inst);
        // 进行二次尝试
        triedResolver = YES;
        goto retry;
    }

    // 没有找到方法，启动消息转发
    imp = (IMP)_objc_msgForward_impcache;
    cache_fill(cls, sel, imp, inst);
 done:
    runtimeLock.unlockRead();
    return imp;
}

以上就是整个的查找方法流程，然后我们再对其中的一些方法逐一解读。

static method_t *getMethodNoSuper_nolock(Class cls, SEL sel) {
    runtimeLock.assertLocked();
    // 遍历所在类的methods，这里的methods是List链式类型，里面存放的都是指针
    for (auto mlists = cls->data()->methods.beginLists(), end = cls->data()->methods.endLists(); mlists != end; ++mlists) {
        method_t *m = search_method_list(*mlists, sel);
        if (m) return m;
    }

    return nil;
}

这里的对于 class 存储方式，我在以后的博文中会分析其存储结构。
而对于没有实现方法的解析过程中，会有以下过程：
void _class_resolveMethod(Class cls, SEL sel, id inst) {
    if (! cls->isMetaClass()) {
        // try [cls resolveInstanceMethod:sel]
        // 针对于对象方法的操作
        // 这个方法是动态方法解析中，当收到无法解读的消息后调用。
        // 这个方法也会用在@dynamic，以后会在消息转发机制的源码分析中介绍
        _class_resolveInstanceMethod(cls, sel, inst);
    } 
    else {
        // try [nonMetaClass resolveClassMethod:sel]
        // and [cls resolveInstanceMethod:sel]
        // 针对于类方法的操作，说明同上
        _class_resolveClassMethod(cls, sel, inst);
        // 再次启动查询，并且判断是否拥有缓存中消息标记_objc_msgForward_impcache
        if (!lookUpImpOrNil(cls, sel, inst, 
                            NO/*initialize*/, YES/*cache*/, NO/*resolver*/)) {
            // 说明可能不是 metaclass 的方法实现，当做对象方法尝试
            _class_resolveInstanceMethod(cls, sel, inst);
        }
    }
}

来单步调试一下程序，由于我们的test方法属于正常的类方法，所以会进入正常地查询类方法列表中查到，进入done函数块，返回到objc_msgSend方法，最终会到我们的函数调用位置：

IMP in Method List Flow
来简单总结一下在第一次调用某个对象方法的消息传递流程：当代码执行到某个对象（第一次）调用某个方法后，首先会确定这个方法的接收者和选择子，并组装成C的objc_msgSend函数形式，启动消息传递机制。
objc_msgSend函数是使用汇编语言实现的，其中我们先尝试的从缓存表中（也就是常说的快速映射表）查询缓存，倘若查询失败，则会将具体的类对象、选择子、接收者在指定的内存单元中存储，并调用__class_lookupMethodAndLoadCache3函数。__class_lookupMethodAndLoadCache3我们俗称为在方法列表中查询的入口函数，他会直接调用lookUpImpOrForward进行查询方法对应的IMP指针。由于我们是方法函数，在获取方法列表后，即可查询到IMP指针。由于是第一次调用，则会把我们的方法加入缓存，并goto到done代码块，返回IMP指针。当objc_msgSend接收到IMP指针后存储至rax寄存器，返回调用函数位置，完成整个消息传递流程。

写在最后
其实消息传递及转发流程是一个相对来说比较复杂的机制。本文所讲述的流程是我们最常见的一种形式。在之后的消息传递与转发的博文中，还会更加深入的探讨这一机制相关流程并深入的阅读源码。

