Objective-C/Runtime/浅谈 block（1） - clang.body:
作者：冬瓜
原文链接：Guardia · 瓜地

浅谈 block - clang 改写后的 block 结构
这几天为了巩固知识，从 iOS 的各个知识点开始学习，希望自己对每一个知识理解的更加深入的了解。这次来分享一下 block 的学习笔记。
block 简介
block 被当做扩展特性而被加入 GCC 编译器中的。自从 OS X 10.4 和 iOS 4.0 之后，这个特性被加入了 Clang 中。因此我们今天使用的 block 在 C、C++、Objective-C 和 Objective-C++ 中均可使用。
对于 block 的语法，只放一张图即可。在之后的 block 系列文章中会详细说明其用法。

C 中的 block
说起 Xcode 的默认编译器 clang ，不得不提及 clang 在整个 编译 - 链接 过程中所起到的作用。在编译期， clang 首先对 Objective-C 代码做分析检查，确保代码中没有任何明显的错误，然后将其转换成为低级的类汇编代码，即我们经常说的中间码。
在学习 Objective-C 中的 block ，会经常使用的 clang 的 -rewrite-objc 命令来将 block 的语法转换成C语言的 struct 结构，从而供我们学习参考。
先从最简单的C语言中的 block 看起：
#include 

void (^outside)(void) = ^{
    printf("Hello block!\n");
};

int main () {
    outside();
    return 0;
}

然后使用 clang -rewrite-objc 命令对 blockTest.c 进行 block 语法转换，得到 blockTest.cpp 这个文件。

在精简代码后，选取出主要关注的代码片段。
struct __block_impl {
    void *isa;
    int Flags;
    int Reserved;
    void *FuncPtr;
};

struct __outside_block_impl_0 {
    struct __block_impl impl;
    struct __outside_block_desc_0* Desc;
    __outside_block_impl_0(void *fp, struct __outside_block_desc_0 *desc, int flags=0) {
        impl.isa = &_NSConcreteGlobalBlock;
        impl.Flags = flags;
        impl.FuncPtr = fp;
        Desc = desc;
    }
};

static void __outside_block_func_0(struct __outside_block_impl_0 *__cself) {
    printf("Hello block!\n");
}

static struct __outside_block_desc_0 {
    size_t reserved;
    size_t Block_size;
} __outside_block_desc_0_DATA = { 
    0, 
    sizeof(struct __outside_block_impl_0)
};

int main () {
    ((void (*)(__block_impl *))((__block_impl *)outside)->FuncPtr)((__block_impl *)outside);
    return 0;
}

代码可能有些难懂，逐一来分析。
static void __outside_block_func_0(struct __outside_block_impl_0 *__cself) {
    printf("Hello block!\n");
}

这个函数应该是和源代码最相近的部分。并且，源代码中的 block 名被重新组合成一种新的字符串形式，而生成了这个函数的函数名。在参数上发现其实这个参数名又是一种新的字符串组合形式（__xxx_block_impl_y：这里的 xxx 是 block 名称，y 是该函数出现的顺序值）。
继续来看看参数 __cself 的声明：
struct __outside_block_impl_0 {
    struct __block_impl impl;
    struct __outside_block_desc_0* Desc;

    // 构造函数
    __outside_block_impl_0(void *fp, struct __outside_block_desc_0 *desc, int flags=0) {
        impl.isa = &_NSConcreteGlobalBlock;
        impl.Flags = flags;
        impl.FuncPtr = fp;
        Desc = desc;
    }
};

第一个成员impl，是 __block_impl 类型，结构体在生成文件中也是出现的：
struct __block_impl {
    void *isa;
    int Flags;
    int Reserved;
    void *FuncPtr;
};


isa指针：指向一个类对象。在非 GC 模式下有三种类型：_NSConcreteStackBlock、_NSConcreteGlobalBlock、_NSConcreteMallocBlock。
Flags：block 的负载信息（引用计数和类型信息），按位存储。在下面有详细说明。
Reserved：保留变量。
FuncPtr：指向 block 函数地址的指针。

在 runtime 的源码中，对于 Flags 的枚举要比文档中描述的更加详细，其定义如下。
enum {
    BLOCK_DEALLOCATING =      (0x0001),  // runtime
    BLOCK_REFCOUNT_MASK =     (0xfffe),  // runtime
    BLOCK_NEEDS_FREE =        (1 
在 clang 的官方文档中，有这么一句话：

The flags field is set to zero unless there are variables imported into the Block that need helper functions for program level Block_copy() and Block_release() operations, in which case the (1

也就是说，一般情况下，一个 block 的 flags 成员默认设置为 0。如果当 block 需要 Block_copy() 和 Block_release 这类拷贝辅助函数，则会设置成 1  ，也就是 BLOCK_HAS_COPY_DISPOSE 类型。可以搜索到大量讲述 Block_copy 方法的博文，其中涉及到了 BLOCK_HAS_COPY_DISPOSE 。
总结一下枚举类的用法，前 16 位即起到标记作用，又可记录引用计数：

BLOCK_DEALLOCATING：释放标记。一般常用 BLOCK_NEEDS_FREE 做 位与 操作，一同传入 Flags ，告知该 block 可释放。
BLOCK_REFCOUNT_MASK：一般参与判断引用计数，是一个可选用参数。
BLOCK_NEEDS_FREE：通过设置该枚举位，来告知该 block 可释放。意在说明 block 是 heap block ，即我们常说的 _NSConcreteMallocBlock 。
BLOCK_HAS_COPY_DISPOSE：是否拥有拷贝辅助函数（a copy helper function）。
BLOCK_HAS_CTOR：是否拥有 block 析构函数（dispose function）。
BLOCK_IS_GC：是否启用 GC 机制（Garbage Collection）。
BLOCK_HAS_SIGNATURE：与 BLOCK_USE_STRET 相对，判断是否当前 block 拥有一个签名。用于 runtime 时动态调用。

我们返回结构体 __outside_block_impl_0 继续看第二个成员 Desc 指针。以下是 __outside_block_desc_0 结构体声明。
static struct __outside_block_desc_0 {
    size_t reserved;
    size_t Block_size;
} __outside_block_desc_0_DATA = { 
    0, 
    sizeof(struct __outside_block_impl_0)
};

其中两个成员也可以从名字看出，描述的是 block 的预留区空间和 block 的大小。其中size_t类型在64位环境下应为long unsigned int，该宏定义在 C标准库 的 stddef.h 中。__outside_block_desc_0_DATA 是该结构体类型的环境量，使用成员对齐方式进行快捷构造。
再来看最重要的部分，即 __outside_block_impl_0 的构造函数。
// 构造函数
__outside_block_impl_0(void *fp, struct __outside_block_desc_0 *desc, int flags=0) {
   impl.isa = &_NSConcreteGlobalBlock;
   impl.Flags = flags;
   impl.FuncPtr = fp;
   Desc = desc;
}

这里的所有过程除了 &_NSConcreteGlobalBlock 以外都比较好理解。先跳过这部分，放在文章最后进行分析。继续看一下入口函数 main()。
int main () {
    ((void (*)(__block_impl *))((__block_impl *)outside)->FuncPtr)((__block_impl *)outside);
    return 0;
}

去掉强制转换部分，增强可读性：
outside -> FuncPtr(outside);

也就是说，在执行我们定义的 block 的时候，会访问 impl 的 FuncPrt 这个函数指针。而在初始化（析构）时，这个函数会被指向 block 的执行函数体，也就是一开始分析的 __outside_block_func_0 方法。并且传入自身为参数。所以上文所提及的 __cself 参数，其实可以理解为面向对象中的所属对象，在 C++ 中我们常用 this 指针描述；而在 Objective-C 中，常常使用 self 。
写到这里，笔者有一些很有意思的联想。在 Objective-C 的设计中，为了突出对象与方法间的所属关系，经常会传递一个指针作为参数。例如在许多 Foundation 框架中的 Delegate 方法，第一个参数往往是委托方法的发起者本身。
最后再来看一下之前略过的 _NSConcreteGlobalBlock 。
对于任意一个对象的 isa 指针，其指向的对象是自身的类对象；而类对象的 isa 指针，指向的是元类（meta class）。而 block 虽然也是对象，但其结构是异于 NSObject 的。最新版本的 object 结构如下：
struct objc_class : objc_object {
    // Class ISA;
    Class superclass;
    cache_t cache;             // formerly cache pointer and vtable
    class_data_bits_t bits;    // class_rw_t * plus custom rr/alloc flags
}


其中 object 的 isa 指针是从 objc_objcet 中继承而来的。而 block 为了模拟 object 结构，也用到了 isa 对其进行了分类。其中 _NSConcreteGlobalBlock 就是其中之一。
关于 block 类型将会在 block 系列其他文中介绍，这里由于我们的 block 是处在全局位置，所以其类型为 _NSConcreteGlobalBlock。
在学习 C 中的 block ，通过 clang 的语义转换将 block 语法使用 C 语言描述，使得我们更进一步的深入学习 block 的内部实现。
对于 clang -rewrite-objc 一种误区
很多时候，会想当然的认为，在编译期，clang 对代码进行语义判断之后，会像 -rewrite-objc 一样对代码进行转译成 C 语言，进而转换成中间码。但是，该命令并不能代表编译后所执行的代码。
在巧哥很久之前谈Objective-C Block的实现的文中，有这么一个代码片段：
#include  

int main() { 
    ^{ printf("Hello, World!\n"); } (); 
    return 0; 
}

在使用 -rewrite-objc 进行语法转换后，所显示的 block 类型为 _NSConcreteStackBlock 。而根据我们对于 block 的认知，当 block 没有引用外部的变量对象时，其类型应为 _NSConcreteGlobalBlock。难道，clang 对于 Objective-C 中的 block 和 C 中的 block 处理，会有差异吗？其实不是的，我们来做这个实验：
#include 

void (^outside)(void) = ^(void) {
    printf("Hello, block!\n");
};

int main() {
    void (^inside)(void) = ^(void) {
        printf("Hello, block!\n");
    };
    printf("outside: %p\n", outside);
    printf("inside:  %p\n", inside);

    return 0;
}

outside: 0x10d48e040
inside:  0x10d48e080

从输出结果上看，两个 block 被存储在同一区域，也就是 .data 常量区。

可是在 main 函数内声明的 block 类型，通过 clang -rewrite-objc 工具转换后仍为 _NSConcreteStackBlock 栈存储 block 类型。从这个侧面，可以明白其实 clang 对语法的解释转换，不一定出现在编译过程中。而在编译期间转换成中间码的过程中，在新版本的 clang 编译器已经不需要解释成c的语法进行过度，从而翻译成中间码。而是，在语法检测后，直接转至中间码，提交至 llvm 进行链接处理。
所以，通过 clang -rewrite-objc 命令，仅将扩展语法通过可读性更高的 C 语法进行改写，而不是编译期中的子编译过程。我们仅仅通过他来了解 block 真正的结构就已经足够了。
尾声
这篇文章讲述了 block 的结构以及指向 block 函数体的具体方式。在以后的 block 系列学习笔记中，还会继续记录 block 类型、 block 使用等相关知识。

参考资料
A look inside blocks (Block_copy)
clang官方文档：block 扩展语法

若想查看更多的iOS Source Probe文章，收录在这个Github仓库中。

Objective-C/Runtime/浅谈 block（2） - 截获变量方式.body:
作者：冬瓜
原文链接：Guardia · 瓜地

浅谈 block - 截获变量方式
本文会通过 clang 的 -rewrite-objc 选项来分析 block 的 C 转换源代码。其分析方式在该系列上一篇有详细介绍。请先阅读 浅谈 block（1） - clang 改写后的 block 结构 。
截获自动变量
首先需要做代码准备工作，我们编写一段 block 引用外部变量的 c 代码。

编译运行成功后，使用 -rewrite-objc 进行改写。
clang -rewrite-objc block.c

简化代码后，得到以下主要代码：
struct __main_block_impl_0 {
    struct __block_impl impl;
    struct __main_block_desc_0* Desc;
    char *str;
    __main_block_impl_0(void *fp, struct __main_block_desc_0 *desc, char *_str, int flags=0) : str(_str) {
        impl.isa = &_NSConcreteStackBlock;
        impl.Flags = flags;
        impl.FuncPtr = fp;
        Desc = desc;
    }                                                                                                                                                                                                      
};

static void __main_block_func_0(struct __main_block_impl_0 *__cself) {
    char *str = __cself->str; // bound by copy
    printf("%s\n", str);
}

static struct __main_block_desc_0 {
    size_t reserved;
    size_t Block_size;
} __main_block_desc_0_DATA = { 
    0, 
    sizeof(struct __main_block_impl_0)
};

int main() {
    char *str = "Desgard_Duan";
    void (*block)() = ((void (*)())&__main_block_impl_0((void *)__main_block_func_0, &__main_block_desc_0_DATA, str));
    ((void (*)(__block_impl *))((__block_impl *)block)->FuncPtr)((__block_impl *)block);
    return 0;
}

与上一篇转换的源码不同的是，block 语法表达中的变量作为成员添加到了 __main_block_func_0 结构体中。
struct __main_block_impl_0 {
    struct __block_impl impl;
    struct __main_block_desc_0* Desc;
    char *str; // 外部引用变量
}

并且，在该结构体中的应用变量类型与外部的类型完全相同。在初始化该结构体实例的构造函数也自然会有所差异：
void (*block)() = ((void (*)())&__main_block_impl_0((void *)__main_block_func_0, &__main_block_desc_0_DATA, str));

去掉强转语法简化代码：
void (*block)() = &__main_block_impl_0(__main_block_func_0, &__main_block_desc_0_DATA, str);

在构造时，除了要传递自身(self) __main_block_func_0 结构体，而且还要传递 block 的基本信息，即 reserved 和 size 。这里传递了一个全局结构体对象 __main_block_desc_0_DATA ，因为他是为 block 量身设计的。最后在将引用值参数传入构造函数中，以便于构造带外部引用参数的 block。
进入构造函数后，发现了含有冒号表达的构造语法：
__main_block_impl_0(void *fp, struct __main_block_desc_0 *desc, char *_str, int flags=0) : str(_str) {
    impl.isa = &_NSConcreteStackBlock;
    impl.Flags = flags;
    impl.FuncPtr = fp;
    Desc = desc;
}

其实，冒号表达式是 C++ 中的一个固有语法。这是显示构造的方法之一。另外还有一种构造显示构造方式，其语法较为繁琐，即使用 this 指针构造。（关于 C++ 构造函数，可以学习 msdn 文档 构造函数 (C++) ）
之后的代码与前一篇分析相同，不再讨论。
通过整个构造 block 流程分析，我们发现当 block 引用外部对象时，会在结构体内部新建立一个成员进行存储。此处我们使用的是 char 类型，而在结构体中所使用的 char 是结构体的成员，所以可以得知：block 引用外部对象时候，不是简单的指针引用（浅复制），而是一种重建（深复制）方式（括号内外分别对于基本数据类型和对象分别描述））。所以如果在 block 中对外部对象进行修改，无论是值修改还是指针修改，自然是没有任何效果。
引入 __block 关键字对截取变量一探究竟
上文中的 block 所引用的外部成员是一个字符型指针，当我们在 block 内部对其修改后，很容易的想到，会改变该指针的指向。而当 block 中引用外部变量为常用数据类型会有些许的不同：
我们来看这个例子 (这是来自 Pro multithreading and memory management for iOS and OS X 2.3.3 一节的例子)：
int val = 0;
void (^blk)(void) = ^{val = 1};

执行代码后会报 error ：
error: variable is not assignable (missing __block type specifier)
    void (^blk)(void) = ^{val = 1};

上述书中对此情况是这样解释的：

block 中所使用的被截获自动变量如同“带有自动变量值的匿名函数”，仅截获自动变量的值。 block 中使用自动变量后，在 block 的结构体实力中重写该自动变量也不会改变原先截获的自动变量。

这应该是 clang 对 block 的引用外界局部值做的保护措施，也是为了维护 C 语言中的作用域特性。既然谈到了作用域，那么是否可以使用显示声明存储域类型从而在 block 中修改该变量呢？答案是可以的。当 block 中截取的变量为静态变量（static），使用下例进行试验：
int main() {
    static int static_val = 2;
    void (^blk)(void) = ^{
        static_val = 3;
    };
}

装换后的代码：
struct __main_block_impl_0 {
    struct __block_impl impl;
    struct __main_block_desc_0* Desc;
    int *static_val;
    __main_block_impl_0(void *fp, struct __main_block_desc_0 *desc, int *_static_val, int flags=0) {
        impl.isa = &_NSConcreteStackBlock;
        impl.Flags = flags;
        impl.FuncPtr = fp;
        Desc = desc;
    }
};

int main() {
    static int static_val = 2;
    void (*blk)(void) = ((void (*)())&__main_block_impl_0((void *)__main_block_func_0, &__main_
    return 0;
 }

会发现在构造函数中使用的静态指针 int *_static_val 对其进行访问。将静态变量 static_val 的指针传递给 __main_block_impl_0 结构体的构造函数并加以保存。通过指针进行作用域拓展，是 C 中很常见的思想及做法，也是超出作用域使用变量的最简单方法。
那么我们为什么在引用自动变量的时候，不使用该自动变量的指针呢？是应为在 block 截获变量后，原来的自动变量已经废弃，因此block 中超过变量作用域从而无法通过指针访问原来的自动变量。
为了解决这个问题，其实在 block 扩展中已经提供了方法（官方文档）。即使用 __block 关键字。
__block 关键字更准确的表达应为 block说明符(block storage-class-specifier) ，用来描述存储域。在 C 语言中已经存有如下存储域声明关键字：

typedef：常用在为数据类型起别名，而不是一般认识的存储域声明关键字作用。但在归类上属于存储域声明关键字。
extern：限制标示，限制定义变量在所有模块中作为全局变量，并只能被定义一次。
static：静态变量存储在 .data 区。
auto：自动变量存储在栈中。
register：约束变量为单值，存储在CPU寄存器内。

__block 关键字类似于 static、auto、register，用于将变量存于指定存储域。来分析一下在变量声明前增加 __block 关键字后 clang 对于 block 的转换动作。
__block int val = 1;
void (^blk)(void) = ^ {
   val = 2;
};

// 要点 1：__block 变量转换结构
struct __Block_byref_val_0 {
    void *__isa;
    __Block_byref_val_0 *__forwarding;
    int __flags;
    int __size;
    int val;
};

struct __main_block_impl_0 {
    struct __block_impl impl;
    struct __main_block_desc_0* Desc;
    __Block_byref_val_0 *val; // by ref
    __main_block_impl_0(void *fp, struct __main_block_desc_0 *desc, __Block_byref_val_0 *_val, int flags=0) : val(_val->__forwarding) {
        impl.isa = &_NSConcreteStackBlock;
        impl.Flags = flags;
        impl.FuncPtr = fp;
        Desc = desc;
    }
};

static void __main_block_func_0(struct __main_block_impl_0 *__cself) {
    __Block_byref_val_0 *val = __cself->val; // bound by ref
    // 要点 2：__forwarding 自环指针存在意义
     (val->__forwarding->val) = 2;
}

static struct __main_block_desc_0 {
    size_t reserved;    
    size_t Block_size;
    // 要点 3：copy/dispose 方法内部实现
    void (*copy)(struct __main_block_impl_0*, struct __main_block_impl_0*);
    void (*dispose)(struct __main_block_impl_0*);
} __main_block_desc_0_DATA = { 
    0, 
    sizeof(struct __main_block_impl_0), 
    __main_block_copy_0, 
    __main_block_dispose_0
    };

int main() {
    __attribute__((__blocks__(byref))) __Block_byref_val_0 val = {
        (void*)0,
        (__Block_byref_val_0 *)&val, 
        0, 
        sizeof(__Block_byref_val_0), 1
    };
    void (*blk)(void) = ((void (*)())&__main_block_impl_0((void *)__main_block_func_0, &__main_block_desc_0_DATA, (__Block_byref_val_0 *)&val, 570425344));
    return 0;
}

发现核心代码部分有所增加，我们先从入口函数看起。
__Block_byref_val_0 val = {
    (void*)0,
    (__Block_byref_val_0 *)&val, 
    0, 
    sizeof(__Block_byref_val_0), 
    1
};

原先的 val 变成了 __Block_byre_val_0 结构体类型变量。并且这个结构体的定义是之前未曾见过的。并且我们将 val 初始化的数值 1，也出现在这个构造中，说明该结构体持有原成员变量。
struct __Block_byref_val_0 {
    void *__isa;
    __Block_byref_val_0 *__forwarding;
    int __flags;
    int __size;
    int val;
};

在 __block 变量的结构体中，除了有指向类对象的 isa 指针，对象负载信息 flags，大小 size，以及持有的原变量 val，还有一个自身类型的 __forwarding 指针。从构造函数中，会发现一个有趣的现象，__forwarding 指针会指向自身，形成自环。后面会详细介绍它。
而在 block 体执行段，是这样定义的。
static void __main_block_func_0(struct __main_block_impl_0 *__cself) {
    __Block_byref_val_0 *val = __cself->val; // bound by ref
     (val->__forwarding->val) = 2;
}

第一步中获得 val 的方法和 block 中引用外部变量的方式是一致的，通过 self 来获取变量。而对于外部 block 变量赋值的时候，这种写法引起了我们的注意：`(val->forwarding->val) = 2;` ，这样做的目的何在，在后文会做出分析。
__block 变量结构

当 block 内部引用外部的 block 变量，会使用以上结构对 block 做出转换。另外，该结构体并不声明在 __main_block_impl_0 block 结构体中，是因为这样可以对多个 block 引用 __block 情况下，达到复用效果，从而节省不必要的空间开销。
__block int val = 0;
void (^blk1)(void) = ^{val = 1;};
void (^blk2)(void) = ^{val = 2;};

只观察入口方法：
__Block_byref_val_0 = {0, &val, 0, sizeof(__Block_byref_val_0), 10};
blk1 = &__main_block_impl_0(__main_block_func_0
                                    , &__main_block_desc_0_DATA
                                    , &val
                                    , 0x22000000);

blk2 = &__main_block_impl_0(__main_block_func_1
                                    , &__main_block_desc_1_DATA
                                    , &val
                                    , 0x22000000);

发现 val 指针被复用，使得两个 block 同时使用一个 __block 只需要对其结构声明一次即可。
接触 Objective-C 语言环境下的 block
通过两篇文的 block 的结构转换，我们发现其实 block 的实质是一个对象 (Object)，从封装成结构体对象，再到 isa 指针结构，都是明显的体现。对于 block 也是如此，在转换后将其封装成了 block 结构体类型，以对象方式处理。
带着 C 代码中的 block 扩展转换规则开始进入 Objective-C block 的学习。首先需要知道 block 的三个类型。



类型
对象存储域
地址单元




_NSConcreteStackBlock
栈
高地址


_NSConcreteMallocBlock
堆



_NSConcreteGloalBlock
静态区(.data)
低地址



在上一篇文中的末尾部分，简单的说了一下全局静态的存储问题。这里再一次强调， _NSConcreteGloalBlock 的 block 会在一下两种情况下出现（与 clang 转换结果不大相同）：

全局变量位置
block 中不引用外部变量

而在其他情况下，基本上 block 的类型都为 _NSConcreteStackBlock 。但是在栈上的 block 会受到作用域的限制，一旦所属的变量作用域结束，该 block 就会被释放。由此，引出了 _NSConcreteMallocBlock 堆 block 类型。
block 提供了将 block 和 __block 变量从栈上复制到堆上的方法来解决这个问题。将配置在站上的 block 复制到堆上，这样可以保证在 block 变量作用域结束后，堆上仍旧可访问。
block 变量通过 forwarding 可以无论在堆上还是栈上都能正常访问。当 block 存储在堆上的时候，对应的栈上 block 的 forwarding 成员会断开自环，而指向堆上的 block 对象。这也就是 forwarding 指针存在的真实用意。

在复制到堆的过程中，forwarding 指针是如何更改指向的？这个问题在下一篇中进行介绍。这篇文主要讲述了 block 变量在 block 中的结构，以及如何获取外部变量，并可以对其修改的详细过程，希望有所收获。

