    switch (__CFArrayGetType(array)) {
    // 只允许两种数组类型
    // 不可变对应普通线性结构，可变对应双端队列
    case __kCFArrayImmutable:
    case __kCFArrayDeque:
    // 取地址再加上索引偏移量，返回元素地址
    return __CFArrayGetBucketsPtr(array) + idx;
    }
    return NULL;
}

通过索引下标查询操作中，CFArray 仍然继承了传统数组的连续地址空间的性质，所以其时间仍然可保持在 O(1) 复杂度，十分高效。
