对于常用的 setImageWithURL 方法，可以总结成以下流程：

从最常用的 setImageWithURL 可以看出，其实 SDWebImage 的逻辑很清晰，其源码阅读起来可读性也很高。
在阅读三方库源码的同时，也可以感受到作者的代码经验所在。如同委托构造的方式，也是经验的积累总结。所以在学习代码的同时，也可以学习编码思想。
