创建图像空间的函数原型和参数定义
CGContextRef CGBitmapContextCreate (
   void *data, // 指向要渲染的绘制内存地址，这个内存块的大小至少是（bytesPerRow*height）个字节
   size_t width, // bitmap 的高度，单位为像素
   size_t height, // bitmap 的高度，单位为像素
